●極軟質のため、アクチュエータ周りなどの揺動部、小さな曲げ半径を必要とするコンパクト配管に最適です。<BR>●色:クリア●外径(mm):12●内径(mm):9●全長(m):20●最小曲げ半径(mm):38●肉厚(mm):1.5●チューブ外径(φD)(mm):φ12●チューブ内径(φD)(mm):φ9●最小取付半径(mm):57●質量(g):1140<BR>●使用流体：空気●使用真空圧力：-100kPa●使用温度範囲：-15～50℃(凍結なきこと)●ISO9001認証取得工場製●ISO14001認証取得工場製<BR>●TPU（熱可塑性ポリウレタン）<BR>●チューブに引張り、ねじり、極端な曲げ等の負荷がかからないようにしてください。チューブのつぶれ、破裂、抜けの原因となる可能性があります。●チューブをこすれたり、からませたりしてキズがつかないようにしてください。チューブの破裂の原因となる可能性があります。●チューブの破壊圧力は温度の上昇と共に低下しますので、使用圧力をよく理解し充分余裕のある安全率をみてください。●チューブは最小曲げ半径以上でご使用ください。●チューブの配管は、長さの変化等を考慮し充分余裕をみてください。<tr><td colspan="2">
